import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-inscription-agence',
  templateUrl: './inscription-agence.component.html',
  styleUrls: ['./inscription-agence.component.css']
})
export class InscriptionAgenceComponent {
  constructor(private a:Router){}

  gotohome(){
    this.a.navigate(["/"])
  }


}
